import React from 'react';
import './AnimatedBackground.css';

const AnimatedBackground = ({ variant = 'admin' }) => {
    return (
        <div className={`animated-background-area ${variant}`}>
            <ul className="animated-circles">
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
                <li></li>
            </ul>
        </div>
    );
};

export default AnimatedBackground;
